CREATE TABLE IF NOT EXISTS egressos (
    `id` INT,
    `nomeCompactado` VARCHAR(21) CHARACTER SET utf8,
    `nome` VARCHAR(38) CHARACTER SET utf8,
    `email` VARCHAR(50) CHARACTER SET utf8,
    `linkedin` VARCHAR(72) CHARACTER SET utf8,
    `github` VARCHAR(33) CHARACTER SET utf8,
    `lattes` VARCHAR(38) CHARACTER SET utf8,
    `researchgate` VARCHAR(49) CHARACTER SET utf8,
    `facebook` VARCHAR(47) CHARACTER SET utf8,
    `twitter` VARCHAR(36) CHARACTER SET utf8,
    `instagram` VARCHAR(40) CHARACTER SET utf8,
    `stackoverflow` VARCHAR(53) CHARACTER SET utf8,
    `curso` VARCHAR(23) CHARACTER SET utf8,
    `campus` VARCHAR(7) CHARACTER SET utf8,
    `egresso` VARCHAR(4) CHARACTER SET utf8,
    `avatar` VARCHAR(16) CHARACTER SET utf8
);
